    "u-s-virgin-islands-landings-statistics",nt"isopen": false,nt"url": null,nt"notes":
    "This data set contains quantities and values for all seafood products that are
    reported landed in St. Thomas, St. Croix or St. John, U.S. Virgin Islands.  These
    data are reported by fishermen that are licensed by the Territorial Government and
    are required to complete and submit fishing logs for each trip.  There have been
    several major changes in the reporting forms throughout the program history which
    affect the data.  These are documented separately.  These are raw data are not corrected
    for non-compliance with the reporting regulations unless otherwise specified.  For
    the purpose of these metadata, the word 'confidential' generally refers to sensitive
    data.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
